  true,\n\t\"url\": null,\n\t\"notes\": \"Map showing coverage of current Resource
  imagery projects. High resolution/large scale Resource imagery is typically acquired
  for the U.S. Forest Service and other agencies for resource managment, monitoring,
  and inventory of land, minerals, vegetation, wildlife habitat, recreation, and travel
  etc. Imagery is typically collected in stereo for 3D viewing/analysis and often
  delivered in an orthorectified format as well. Please note: Resource imagery projects
  may span more than one project year. Imagery is contracted and inspected at the
  Aerial Photography Field Office in Salt Lake City, Utah.\",\n\t\"license_title\":
